.minWraper {
  width: 100%;
  height: 800px;
  background: #eee;
}

.head {
  height: 80px;
  padding: 30px;
  box-sizing: border-box;
  font-size: 30px;
}

.top {
  height: 150px;
  background: #fff;
  border-radius: 15px;
  display: flex;
  .examType {
    margin-top: 28px;
    margin-left: 70px;
    span {
      margin: 0 15px;
    }
    .name {
      width: 280px;
    }
  }

  .classType {
    margin-top: 28px;
    margin-left: 100px;
    span {
      margin: 0 15px;
    }
    .name {
      width: 280px;
    }
  }

  .search {
    width: 150px;
    margin-top: 28px;
    margin-left: 50px;
  }
}

.content {
  background: rgb(255, 255, 255);
  padding: 24px;
  margin: 20px 0px 20px;
  border-radius: 10px;
  h4 {
    margin-top: 10px;
  }
  .ctop {
    display: flex;
    justify-content: space-between;
    .active {
      color: #409eff;
    }
  }
}
